            try! decoder.decode(FoodItem.self, from: Data(pizza.utf8)),
            try! decoder.decode(FoodItem.self, from: Data(softDrink.utf8))
        ]
        return foods
    }
    
    public func deleteFood(_ food: FoodItem) throws {}
    
    public func getFood(_ id: Int) throws -> FoodItem? {
        let jsonData = Data(porkSausage.utf8)
        return try! JSONDecoder().decode(FoodItem.self, from: jsonData)
